import React from 'react';
import { Container, Grid, Card, CardContent, Typography, Box } from '@mui/material';

const LandingPage = () => {
    const cards = [
        {
            title: 'Post a job and hire a pro',
            subtitle: 'Talent Marketplace™',
            description: 'Find top talent for your projects.',
            linkText: '→',
            backgroundColor: '#4CAF50',
        },
        {
            title: 'Browse and buy projects',
            subtitle: 'Project Catalog™',
            description: 'Discover pre-packaged services.',
            linkText: '→',
            backgroundColor: '#2196F3',
        },
        {
            title: 'Get advice from an industry expert',
            subtitle: 'Consultations',
            description: 'Connect with experienced professionals.',
            linkText: '→',
            backgroundColor: '#FFC107',
        },
    ];

    return (
        <Box
            sx={{
                position: 'relative',
                overflow: 'hidden',
                height: '100vh',
                backgroundImage:
                    "url('https://images.unsplash.com/photo-1593642634367-d91a135587b5?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&q=80&w=1920')",
                backgroundSize: 'cover',
                backgroundPosition: 'center',
            }}
        >
            <Box
                sx={{
                    position: 'absolute',
                    top: 0,
                    left: 0,
                    width: '100%',
                    height: '100%',
                    backgroundColor: 'rgba(0, 0, 0, 0.5)',
                }}
            ></Box>
            <Container maxWidth="lg" sx={{ position: 'relative', zIndex: 2, pt: 10, pb: 5 }}>
                <Typography
                    variant="h2"
                    sx={{
                        color: 'white',
                        fontWeight: 'bold',
                        mb: 2,
                        textAlign: { xs: 'center', md: 'left' },
                    }}
                >
                    Find talent your way
                </Typography>
                <Typography
                    variant="h6"
                    sx={{
                        color: 'white',
                        mb: 5,
                        textAlign: { xs: 'center', md: 'left' },
                    }}
                >
                    Work with the largest network of independent professionals and get things done—quick turnarounds to big transformations.
                </Typography>
                <Grid container spacing={4}>
                    {cards.map((card, index) => (
                        <Grid item xs={12} sm={6} md={4} key={index}>
                            <Card
                                sx={{
                                    backgroundColor: card.backgroundColor,
                                    color: 'white',
                                    height: '100%',
                                    display: 'flex',
                                    flexDirection: 'column',
                                    justifyContent: 'center',
                                    alignItems: 'center',
                                    p: 3,
                                    boxShadow: '0px 4px 20px rgba(0, 0, 0, 0.3)',
                                    transition: 'transform 0.3s ease, box-shadow 0.3s ease',
                                    '&:hover': {
                                        transform: 'translateY(-5px)',
                                        boxShadow: '0px 8px 30px rgba(0, 0, 0, 0.5)',
                                    },
                                }}
                            >
                                <Typography variant="h5" sx={{ fontWeight: 'bold', mb: 1 }}>
                                    {card.title}
                                </Typography>
                                <Typography variant="subtitle1" sx={{ fontWeight: '300', mb: 2 }}>
                                    {card.subtitle}
                                </Typography>
                                <Typography variant="body2" sx={{ textAlign: 'center', mb: 2 }}>
                                    {card.description}
                                </Typography>
                                <Typography
                                    variant="h5"
                                    sx={{
                                        fontWeight: 'bold',
                                        cursor: 'pointer',
                                    }}
                                >
                                    {card.linkText}
                                </Typography>
                            </Card>
                        </Grid>
                    ))}
                </Grid>
            </Container>
        </Box>
    );
};

export default LandingPage;
